import React from "react";
import { connect } from 'react-redux'
import "../styles/Signup.css";


//state for email/username/password

const Signup = (props) => {

  const { signupState } = this.props
  console.log(signupState)
  return (
    <div className='app-body'>
      <div className='app-container'>
        <div className='header'>
          <h1>Welcome - It's good to see you</h1>
          <h2>Let's get you signed in</h2>
        </div>
        <div className='form-container'>
          <form>
            <label>Email address</label>
            <input className='field' placeholder='e.g abc@hotmail.com'></input>
            <label>Username</label>
            <input className='field' placeholder='Choose your user id. e.g sudokumeister1337'></input>
            <label>Password</label>
            <input className='field' placeholder='Must be minimum 8 characters length'></input>
            <button type='submit'>Submit</button>
          </form>
        </div>
      </div>
    </div>
  );
};

const mapStateToProps = (state) => {
  return {
    signupState: state.signupState
  }
}

export default connect(mapStateToProps)(Signup);
